    function sectorStyle(f) {

        for (const sec in subsectorLayers) {
            for (const id in subsectorLayers[sec]) {
                const layer = subsectorLayers[sec][id];
                if (sec === selected || selected === "") {
                    layer.setStyle({ fillOpacity: 0.6 });
                    if (sec === selected) {
                        const name = layer.feature.properties["Subsector Name"];
                        const opt = document.createElement("option");
                        opt.value = id;
                        opt.textContent = name;
                        subDropdown.appendChild(opt);
                    }
                } else {
                    layer.setStyle({ fillOpacity: 0.05 });
                }
            }
        }
    });

    document.getElementById("subsectorSelect").addEventListener("change", function () {
        const selected = this.value;
        const sector = document.getElementById("sectorSelect").value;

        if (highlightedSubsector) {
            highlightedSubsector.setStyle(subsectorStyle(highlightedSubsector.feature));
        }

        for (const sec in subsectorLayers) {
            for (const id in subsectorLayers[sec]) {
                subsectorLayers[sec][id].setStyle({ fillOpacity: 0.05 });
            }
        }

        if (selected && sector && subsectorLayers[sector][selected]) {
            const layer = subsectorLayers[sector][selected];
            layer.setStyle({ fillOpacity: 0.9, weight: 3, color: '#000' });
            map.fitBounds(layer.getBounds());
            highlightedSubsector = layer;
        }
    });

    function resetMap() {
        document.getElementById("sectorSelect").value = "";
        document.getElementById("subsectorSelect").innerHTML = "<option value=''>Select Subsector</option>";
        document.getElementById("toggleBoundaries").checked = true;

        for (const name in sectorLayers) {
            sectorLayers[name].setStyle({ opacity: 1, weight: 4 });
        }
        for (const sec in subsectorLayers) {
            for (const id in subsectorLayers[sec]) {
                subsectorLayers[sec][id].setStyle(subsectorStyle(subsectorLayers[sec][id].feature));
            }
        }
        highlightedSubsector = null;
        map.setView([25.2, 55.3], 10);
    }
    </script>
</body>
</html>
